import React from 'react'
import {TheSidebar} from '../../../containers/index'
import Header from "../../users/Header";

const Home = (props) => {
  return (
    <>
      <Header state={props.state}/>
      <div className="c-app c-default-layout">
        <TheSidebar/>
        <div className="c-wrapper">
        </div>
      </div>
    </>
  )
}

export default Home
